import React from 'react';
import { Formik, Field, Form } from 'formik';
import axios from 'axios';
import { useHistory } from 'react-router-dom/cjs/react-router-dom.min';

const Sineupform = () => {
    const history = useHistory();

    return (
        <>
            <div  className='container d-flex flex-column  justify-content-center align-items-center' style={{marginTop:"100px"}}>
          
                <Formik
                    initialValues={{
                        fristname: '',
                        lastname: '',
                        email: '',
                        password: ''
                    }}
                    onSubmit={async (values) => {
                        axios.post('http://localhost:3000/sineup', values)
                            .then(function (response) {
                                // handle success
                                console.log(response);
                                localStorage.setItem('token', response.data.token)
                            })
                            .catch(function (error) {
                                // handle error
                                console.log(error);
                            })
                    }}
                >
                    <div style={{ backgroundColor: "grey", height: "500px", padding: "25px 100px" }}>
                    <h1>Sign Up</h1>
                        <Form >
                            <label htmlFor="fristname"  className='fs-4 text-light'>First Name</label>
                            <br />
                            <Field id="fristname" className="px-2 py-2 " name="fristname" placeholder="enter frist name" />
                            <br /><br />


                            <label htmlFor="lastname" className='fs-4 text-light'>Last Name</label>
                            <br />
                            <Field id="lastname" className="px-2 py-2 "  name="lastname" placeholder="enter last name" />
                            <br /><br />
                            <label htmlFor="email">Email</label>
                            <br />
                            <Field
                                id="email"
                                name="email"
                                placeholder="enter email"
                                type="email"
                            />
                            <br /><br />
                            <label htmlFor="password">Password</label>
                            <Field
                                id="password"
                                name="password"
                                placeholder="enter password"
                                type="password"
                            />
                            <br /><br />
                            <button type="submit">Submit</button>
                            <button onClick={() => history.push('/login')}>login</button>
                        </Form>
                    </div>

                </Formik>
            </div>
        </>
    )
}

export default Sineupform
